import pstats

def analyze_profile_data(profile_file):
    stats = pstats.Stats(profile_file)
    stats.strip_dirs()
    stats.sort_stats('')
    stats.calc_callees()
    total_time = stats.total_tt
    function_stats = {}
    for (func, (cc, nc, tt, ct, callers)) in stats.stats.items():
        function_stats[func] = {'time': tt, 'calls': nc}
    return {'total_time': total_time, 'function_stats': function_stats}

